		"text": "@minds_making @PaulRitterbush The key point is that I agree with dualists that we have concepts of purely qualitative and nonfunctional mental properties, which, if real, would pose a problem for physicalism. Call them what you like, I deny that such properties exist. That's a substantive claim."
